",\"versionedName\":\"PAD_UWI\",\"type\":\"string\",\"reference\":null,\"publishers\":[\"ARCGIS\",\"WELLVIEW\",\"GEOGRAPHIX\",\"ENERTIA\",\"ARIES\"],\"subscribers\":[]},{\"name\":\"SOURCE_REFERENCE_NUM\",\"displayName\":\"Source Reference Number\",\"versionedName\":\"SOURCE_REFERENCE_NUM\",\"type\":\"string\",\"reference\":null,\"publishers\":[],\"subscribers\":[]}]}]}");
    

            Server server = new Server
            {
                Services = {Publisher.BindService(new Plugin_Naveego_Legacy.Plugin.Plugin(mockHttp.ToHttpClient()))},
                Ports = {new ServerPort("localhost", 0, ServerCredentials.Insecure)}
            };
            server.Start();

            var port = server.Ports.First().BoundPort;

            var channel = new Channel($"localhost:{port}", ChannelCredentials.Insecure);
            var client = new Publisher.PublisherClient(channel);

            var connectRequest = GetConnectSettings();

            var request = new DiscoverSchemasRequest
            {
                Mode = DiscoverSchemasRequest.Types.Mode.All,
            };

            // act
            client.Connect(connectRequest);
            var response = client.DiscoverSchemas(request);

            // assert
            Assert.IsType<DiscoverSchemasResponse>(response);
            Assert.True(response.Schemas.Count == 5, "Schema Length was not 5");
            
            Assert.True(response.Schemas.Any(s => s.Id == "WELL"), "Missing Schema WELL");
            Assert.True(response.Schemas.Any(s => s.Id == "WELLBORE"), "Missing Schema WELLBORE");
            Assert.True(response.Schemas.Any(s => s.Id == "COMPLETION"), "Missing Schema COMPLETION");
            Assert.True(response.Schemas.Any(s => s.Id == "PAD"), "Missing Schema PAD");
            Assert.True(response.Schemas.Any(s => s.Id == "FACILITY"), "Missing Schema FACILITY");

            var wellSchema = response.Schemas.First(s => s.Id == "WELL");
            Assert.True(wellSchema.Properties.Count == 35, $"Expected WELL property count to be 35 but was {wellSchema.Properties.Count}");

            var wellBoreSchema = response.Schemas.First(s => s.Id == "WELLBORE");
            Assert.True(wellBoreSchema.Properties.Count == 24, $"Expected WELLBORE property count to be 24 but was {wellBoreSchema.Properties.Count}");
            
            var completionSchema = response.Schemas.First(s => s.Id == "COMPLETION");
            Assert.True(completionSchema.Properties.Count == 24, $"Expected COMPLETION property count to be 24 but was {completionSchema.Properties.Count}");
            
            var padSchema = response.Schemas.First(s => s.Id == "PAD");
            Assert.True(padSchema.Properties.Count == 14, $"Expected PAD property count to be 14 but was {padSchema.Properties.Count}");
            
            var facilitySchema = response.Schemas.First(s => s.Id == "FACILITY");
            Assert.True(facilitySchema.Properties.Count == 7, $"Expected FACILITY property count to be 7 but was {facilitySchema.Properties.Count}");

            
            // cleanup
            await channel.ShutdownAsync();
            await server.ShutdownAsync();
        }

